  return (
    <div>
        <form className='createname'>
         <input placeholder='Title'></input>
         <textarea placeholder='Take a note...'></textarea>
         <Fab color="primary" aria-label="add">
       <AddIcon />
      </Fab>
        </form>
    </div>
  )
}

export default Createarea;
